import React from "react";

function Awards() {
  return (
    <div class="container mt-5">
      <div className="row">
        <div className="col-6">
          <img src="media/images/largestBroker.svg" alt="awards" />
        </div>
        <div className="col-6">
          <h1></h1>
        </div>
      </div>
    </div>
  );
}

export default Awards;
